import React from 'react';
import {Link} from 'react-router-dom'

import '../css/App.css'

const PleaseLog = (props) => {
    return (
        <div>
            <div className="contenedor-button button"> 
                <Link to={'/'} onClick={props.auth.login}> Log In </Link>  
            </div>     
         </div>
    );
};

export default PleaseLog;
